import React from 'react'

function Gallery() {
    const imageArray = [
        {
            src: 'images/PXP-0982.jpg'
        },
        {
            src: 'images/PXP-0982.jpg'
        },
        {
            src: 'images/PXP-0982.jpg'
        },
        {
            src: 'images/PXP-0982.jpg'
        },
        {
            src: 'images/PXP-0982.jpg'
        },
        {
            src: 'images/PXP-0982.jpg'
        },
    ]
  return (
    <div>
        {
            imageArray.map((image, index) => {
                <div key={index}>
                    <div></div>
                </div>
            })
        }
    </div>
  )
}

export default Gallery
